  const currentYear = new Date().getFullYear();

  return (
    <>
      <div className="bg-dark" style={{ minHeight: "500px" }}>
             <img style={{width: '.5rem'}} src={'https://images.footlocker.com/content/dam/final/footlockereurope/Online_activations/fl-campaign/2021/2021_06_035_onl_new_hp_layout/04_final_output_files/2021_06_035_ONL_Nike_bar_800x280.jpg'} alt="" />
