        <img src={'https://images.footlocker.com/content/dam/final/footlockereurope/Online_activations/fl-campaign/2021/2021_06_035_onl_new_hp_layout/04_final_output_files/2021_06_035_ONL_Jordan_bar_800x280.jpg'} alt="" />
        <img src={'https://images.footlocker.com/content/dam/final/footlockereurope/Online_activations/fl-campaign/2021/2021_06_035_onl_new_hp_layout/04_final_output_files/2021_06_035_ONL_all_brands_bar_en_800x280.jpg'} alt="" />

        <div className="">
          <Link to="">
            <strong>Home</strong>
          </Link>
          <Link to="">About us</Link>
          <Link to="">Favorites</Link>
          <Link to="">Contact Me</Link>
        </div>
      </div>
      <div style={{ padding: "2rem" }}>
        Â© {currentYear} Nati Peretz. All rights reserved.
      </div>
    </>
  );
};

export default Footer;
